$('#clearCanvas').mousedown(function(e)
	{
		clickX = new Array();
		clickY = new Array();
		clickDrag = new Array();
		clearCanvas(); 
		recalculate();
	});
	
function clearCanvas()
{
	context.clearRect(0, 0, canvas.width, canvas.height);
}

var clickX = new Array();
var clickY = new Array();
var clickDrag = new Array();
var paint;

function addClick(x, y, dragging)
{
  clickX.push(x);
  clickY.push(y);
  clickDrag.push(dragging);
}

function redraw(){
  context.clearRect(0, 0, context.canvas.width, context.canvas.height); // Clears the canvas
  
  context.strokeStyle = "#000000";
  context.lineJoin = "round";
  context.lineWidth = 8;
			
  for(var i=0; i < clickX.length; i++) {		
    context.beginPath();
    if(clickDrag[i] && i){
      context.moveTo(clickX[i-1], clickY[i-1]);
     }else{
       context.moveTo(clickX[i]-1, clickY[i]);
     }
     context.lineTo(clickX[i], clickY[i]);
     context.closePath();
     context.stroke();
  }
}

function recalculate(){
    var dataRGB = context.getImageData(0,0,canvas.width,canvas.height).data;
    var dataBW = [];
    for(var i=0;i<dataRGB.length;i++){
      if(i%4 == 3) dataBW.push(dataRGB[i]/255);
    }
    
    if(modelReady){
		var input = tf.pool(tf.tensor4d(dataBW, [1, 224, 224, 1]), 8, 'avg', 'valid', 1, 8);
		var prediction = model.predict(input).dataSync();
	    for(var i=0;i<prediction.length;i++){
		  document.getElementById("probabilities").children[0].children[i].children[1].innerHTML = Math.floor(Math.round(prediction[i]*1000)/10) + "," + (Math.round(prediction[i]*1000)%10) + "%";
		  document.getElementById("probabilities").children[0].children[i].children[2].children[0].style.width = Math.round(prediction[i]*100) + "px";
	      if(prediction[i]==Math.max(...prediction)){
			  document.getElementById("probabilities").children[0].children[i].children[0].style.fontWeight = "bold";
			  document.getElementById("probabilities").children[0].children[i].children[1].style.fontWeight = "bold";
		  }
		  else{
			  document.getElementById("probabilities").children[0].children[i].children[0].style.fontWeight = "";
			  document.getElementById("probabilities").children[0].children[i].children[1].style.fontWeight = "";
		  }
		}
		
		arrayToCanvas(document.getElementById("canvasWrapperInput"),input.dataSync(),input.shape[1],input.shape[2],hiddenLayerOutputScaling1,hiddenLayerOutputScaling1);
		
		for(var i=0;i<hiddenLayerHelperModels.length;i++){
			var hiddenLayerPrediction = hiddenLayerHelperModels[i].predict(input);
			var hiddenLayerOutput = hiddenLayerPrediction.dataSync();
			var hiddenLayerPredictionPooled = tf.pool(hiddenLayerPrediction,2,'max','valid',1,2);
			var hiddenLayerOutputPooled = hiddenLayerPredictionPooled.dataSync();
			var canvasWrappersConv = document.getElementsByClassName("canvasWrappers"+i*2);
			var canvasWrappersPool = document.getElementsByClassName("canvasWrappers"+(i*2+1));
			for(var j=0;j<hiddenLayerHelperModels[i].outputShape[3];j++){
				var hiddenLayerSingleFilterOutput = [];
				var hiddenLayerSingleFilterOutputPooled = [];
				for(var k=0;k<hiddenLayerOutput.length;k+=hiddenLayerPrediction.shape[3]){
					hiddenLayerSingleFilterOutput.push(hiddenLayerOutput[j+k]);
				}
				for(var k=0;k<hiddenLayerOutputPooled.length;k+=hiddenLayerPredictionPooled.shape[3]){
					hiddenLayerSingleFilterOutputPooled.push(hiddenLayerOutputPooled[j+k]);
				}
				if(i==0){
					arrayToCanvas(canvasWrappersConv[j],hiddenLayerSingleFilterOutput,hiddenLayerPrediction.shape[1],hiddenLayerPrediction.shape[2],hiddenLayerOutputScaling1,hiddenLayerOutputScaling1);
					arrayToCanvas(canvasWrappersPool[j],hiddenLayerSingleFilterOutputPooled,hiddenLayerPredictionPooled.shape[1],hiddenLayerPredictionPooled.shape[2],hiddenLayerOutputScaling1,hiddenLayerOutputScaling1);
				}
				else{
					arrayToCanvas(canvasWrappersConv[j],hiddenLayerSingleFilterOutput,hiddenLayerPrediction.shape[1],hiddenLayerPrediction.shape[2],hiddenLayerOutputScaling2,hiddenLayerOutputScaling2);
					arrayToCanvas(canvasWrappersPool[j],hiddenLayerSingleFilterOutputPooled,hiddenLayerPredictionPooled.shape[1],hiddenLayerPredictionPooled.shape[2],hiddenLayerOutputScaling2,hiddenLayerOutputScaling2);
				}
			}
		}
		
	}
}

